def callback(request, response, data):
    # img needs to be RGB, a float32, and pixel values between 0-1
    img = request.getImage('input_image')[:, :, ::-1].astype(np.float32)/255
    overlayFlag = request.getValue('render')

    pred, proc_im = run_model(net, img, prepIm=vtfm)
    # im_d = (denorm(np.rollaxis(proc_im, 1, 4)).squeeze()
    #         * 255).astype(np.uint8)[:, :, ::-1]

    # Classification
    sk_p, _ = run_model(sk_trainer.learn.model, img, prepIm=v_class_tfms)
    mel_p, _ = run_model(mel_trainer.learn.model, img, prepIm=v_class_tfms)
    sk_fp, mel_fp = np.argmax(sk_p), np.argmax(mel_p)

    cls_pred = 'Nevus'
    cls_conf = 'N/A'
    if sk_fp == 1:
        cls_pred = 'Seborrheic Keratosis'
        cls_conf = str(round(np.exp(sk_p[1]), 3))
    # Mel pred trumps SK
    if mel_fp == 1:
        cls_pred = 'Melanoma'
        cls_conf = str(round(np.exp(mel_p[1]), 3))

    im_d = denorm_img(proc_im, denorm)
    pred_thr = (pred > 0).astype(np.uint8)*255

    response.addValues({'classification': cls_pred, 'confidence': cls_conf})
    response.addImage('input_image', im_d)
    response.addImage('output_image', pred_thr)

    if overlayFlag:
        # load img as PIL
        colorIm = Image.fromarray(im_d)
        # Network prediction as PIL image
        predIm = Image.fromarray(pred_thr, mode='P')
        # blend them together m8
        overlay = Image.blend(colorIm.convert(
            "RGBA"), predIm.convert("RGBA"), 0.5)
        cv_overlay = np.array(overlay)

        # return that sh*t
        response.addImage('ouput_overlay_image', cv_overlay)
        # plt.Figure()
        # plt.subplot(1,2,1)
        # plt.imshow(im_d)
        # plt.subplot(1, 2, 2)
        # plt.imshow(cv_overlay)
        # plt.suptitle(
        #     'Classification: "{}"; pred - {}'.format(cls_pred, cls_conf))
